/**
 * Write the contents of this Row to the printstream.
 */
public void print(PrintStream out) {
  for (Iterator<Character> i = cells.keySet().iterator(); i.hasNext();) {
    Character ch = i.next();
    Cell c = at(ch);
    out.print("[" + ch + ":" + c + "]");
  }
  out.println();
}

